UPDATE `npc_text` SET `text0_1`='Oh it\'s just so horrible, $g sir:miss;. The house Barov was once full of life... full of splendor. The manor was the Barov\'s primary residence amidst their far reaching empire.$B$BLucien and I noticed that as the days progressed, the Barovs became depressed. Despondent. Paranoia and rage often overcame the master and missus. At night, we could hear the Barovs arguing in their chambers. From what we understood, their greed had \'broken the dam,\' so to speak. ',`em0_0`=0,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4043;
UPDATE `npc_text` SET `text0_1`='We suspect that in order to preserve their fortune and hold of the land - well past their lifespan - the Barovs made a deal with a powerful human mage named Kel\'Thuzad.$B$B<Eva shudders.>$B$BFrom this deal sprang the school of necromancy: A place which bore the Cult of the Damned and would become their capital.$B$BAs each week passed, the house Barov became more and more decrepit...$B$BDark beings began to take residence in the various wings of the house. Upkeep became impossible... and disgusting.',`em0_0`=0,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4044;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=6,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4045;
UPDATE `npc_text` SET `em0_0`=0,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4046;
UPDATE `npc_text` SET `text0_1`='Restraints? There are things in this world far more restraining than bars and shackles, young $g master:mistress;. The undead surrounded us, constantly tormenting us with horrifying acts of depravity.$B$BFinally, he came. He introduced himself as Doctor Theolen Krastinov. We came to know him as \'The Butcher.\'$B',`em0_0`=0,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4047;
UPDATE `npc_text` SET `text0_1`='We finally understood what the screams were from. The Butcher exposed us to pain that we did not know existed. He used us in countless experiments, attempting to devise a plague.$B$BThe days turned to weeks. We would have died on the first day had it not been for that cruel monster keeping us alive through magical means.',`em0_0`=0,`em0_2`=0,`em0_3`=1,`em0_5`=1 WHERE `ID`=4048;
