UPDATE `npc_text` SET `text0_1`='No other race on Azeroth has suffered as much as our people, $c. To laugh in the face of death has become second nature for all of us.' WHERE `ID`=4934;
UPDATE `npc_text` SET `text0_0`='There are ways to strengthen steel beyond the hammer and forge, young wanderer.' WHERE `ID`=5184;
UPDATE `npc_text` SET `text0_1`='You don\'t look like much to me, but who knows, maybe there\'s an enchanter hidden in there somewhere!' WHERE `ID`=5195;
UPDATE `npc_text` SET `text0_0`='I don\'t get many visitors.  You\'re looking for something specific, yes?' WHERE `ID`=5228;
UPDATE `npc_text` SET `text0_1`='Greetings, traveler! Care to delve into the mysteries of the arcane? Hm?' WHERE `ID`=5233;
UPDATE `npc_text` SET `text0_1`='We don\'t get many visitors out here. May I interest you in something?' WHERE `ID`=5434;
UPDATE `npc_text` SET `text0_1`='Greetings, and welcome.  I am not very good at smiling, but trust me; I am happy to serve you.' WHERE `ID`=5455;
UPDATE `npc_text` SET `text0_0`='Tailoring can come in very handy. I once had to sew my arm back on.' WHERE `ID`=5556;
UPDATE `npc_text` SET `text0_1`='Cloth is okay. Personally I prefer to work with human skin.' WHERE `ID`=5566;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=5594;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=5865;
UPDATE `npc_text` SET `text0_1`='I do not believe you possess the mental acuity to grasp the nature of portal magic.' WHERE `ID`=5885;
UPDATE `npc_text` SET `text0_1`='I suppose you are here to be trained in the use of a new weapon?  Make it fast, I\'m very busy!' WHERE `ID`=6286;
UPDATE `npc_text` SET `text0_1`='You there... it is in your best interest to aid the Forsaken during these dire times.  Listen closely, as I dislike repeating myself.$B$BWe currently find ourselves in a dire shortage of cloth.  Bandages and simple textiles are running low, and donations are being accepted to bolster sagging inventories.  While you\'ll not receive financial compensation - hence what donation means - your aid will not go unnoticed.' WHERE `ID`=7189;
UPDATE `npc_text` SET `text0_0`='Welcome to the Booty Bay fishing contest where each week we choose the finest fisherman to be the Master Angler!$B$BBetween 2pm and 4pm schools of tastyfish will appear up and down the coast of Stranglethorn.  While fishing if your fishing bobber lands in a tastyfish school then you will catch something from the school rather than the normal stranglethorn fishing fare.$B' WHERE `ID`=7614;
UPDATE `npc_text` SET `text0_0`='*Whirr* *CLANK*$B$BI have been instructed to accept high quality rare fish and return valuable Nat Pagle fishing accessories.   Fish Requested.$B$B*THUMP* *Buzz*$B' WHERE `ID`=7641;
UPDATE `npc_text` SET `text0_1`='Fishmaster Bassbait has had the waters here seeded with high quality Tastyfish so he can have his tournament.$B$BOnce he gets his winner, I will give you silver for each five Tastyfish you bring me!$B' WHERE `ID`=7696;
UPDATE `npc_text` SET `text0_0`='Greetings, $c - I\'m a Commendation Officer acting on behalf of Thunder Bluff.  It is my duty to assist adventurers who have received Horde Commendation Signets.$B$BI accept signets in different quantities, but the most beneficial exchange for you is to hand in a set of ten at once.  I will enter your deeds into our records when you hand in your signets.  As a result, you will earn recognition from Thunder Bluff for your duty and service.$B',`text0_1`='Greetings, $c - I\'m a Commendation Officer acting on behalf of Thunder Bluff.  It is my duty to assist adventurers who have received Horde Commendation Signets.$B$BI accept signets in different quantities, but the most beneficial exchange for you is to hand in a set of ten at once.  I will enter your deeds into our records when you hand in your signets.  As a result, you will earn recognition from Thunder Bluff for your duty and service.$B$B' WHERE `ID`=8132;
