UPDATE `npc_text` SET `text0_0`='Ah, you must be the $glad : lass; assigned to show me around the Eversong Woods.  Took your sweet time getting here, didn\'t you?$B$BVery well, off we go.  Let us not waste one more minute.',`prob0`='1.0' WHERE `ID`=8240;
UPDATE `npc_text` SET `text0_0`='Oh, hello there.. um, what\'s your name?$B$BNo matter, what brings you to my home-away-from-home here out in the beautiful countryside?',`text0_1`='',`prob0`='1.0' WHERE `ID`=8374;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=2 WHERE `ID`=8378;
UPDATE `npc_text` SET `text0_0`='We\'re too merciful with the Wretched.  We ought to drive a sword through each of them.$B$BTheir boldness in Sunsail Anchorage is unpardonable.',`prob0`='1.0' WHERE `ID`=8402;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1 WHERE `ID`=8411;
UPDATE `npc_text` SET `text0_0`='Hello, friend. How may I be of service to you today?',`text0_1`='',`prob0`='1.0' WHERE `ID`=8412;
UPDATE `npc_text` SET `text0_1`='It is shameful that we sin\'dorei have lost so much of what we used to call home.  It shall not be long before we regain our strength and retake our southern lands back from the Scourge!',`prob0`='1.0' WHERE `ID`=8421;
UPDATE `npc_text` SET `text0_0`='The high executor and Dame Auriferous are making me wait, but I don\'t have time for this! My friends are out there dying, $c!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8423;
UPDATE `npc_text` SET `text0_1`='I sent Ranger Salissa south to the enclave and Ranger Lethvalin west to Tranquillien more than a day ago! Have you seen either of them? Are you the aid that\'s been sent back?',`prob0`='1.0' WHERE `ID`=8424;
UPDATE `npc_text` SET `text0_0`='Sometimes it feels like I\'ll never go back to being a simple functionary in service to Dame Auriferous. I\'m not cut out for war.$B$BThankfully there are those like you who burn to see Quel\'Thalas restored to its former beauty. Crush the Scourge, $c! Crush them wherever you can!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8425;
UPDATE `npc_text` SET `text0_0`='What business brings you here, $c?',`text0_1`='',`prob0`='1.0' WHERE `ID`=8429;
UPDATE `npc_text` SET `text0_0`='Ah, hello there, $r. As you can see, I\'m not open for business quite yet. Now, if you\'ll excuse me, I\'m very busy.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8431;
UPDATE `npc_text` SET `text0_1`='Welcome to Tranquillien, $c. I apologize for the state that you find it in. As you can see, we\'ve been having some trouble, but the Forsaken, and their Lady Sylvanas Windrunner, have been gracious enough to lend us a great deal of assistance in our time of need.$B$BIf you can lend a hand please do not hesitate to do so. We can use all of the help that we can get in our struggle against the myriad forces arrayed against us.',`prob0`='1.0' WHERE `ID`=8433;
UPDATE `npc_text` SET `text0_1`='It is very important that we find out what the the night elves are up to, $c! Please concentrate all of your efforts toward that end.',`prob0`='1.0' WHERE `ID`=8439;
UPDATE `npc_text` SET `text0_0`='Are you the reinforcements? The night elves have been routed!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8441;
UPDATE `npc_text` SET `text0_0`='$R, report! What news of significance do you bring? Be quick about your business... Dame Auriferous and I are in the middle of a strategic discussion.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8447;
UPDATE `npc_text` SET `text0_0`='<The blood elf lies on the floor in some manner of induced torpor.>',`text0_1`='',`prob0`='1.0' WHERE `ID`=8457;
UPDATE `npc_text` SET `text0_1`='Greetings, $r.  I am Ambassador Sunsorrow of the sin\'dorei, or blood elves as we are commonly known.  I have high hopes that this new bond between us and the Horde will be mutually beneficial.' WHERE `ID`=8458;
UPDATE `npc_text` SET `text0_0`='The drafts of fresh air that blow from Eversong from time to time really upset my stomach, if you know what I mean.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8464;
UPDATE `npc_text` SET `text0_1`='If it is a matter of import that you wish to speak on, $c, it may be more appropriate to seek an audience with Dame Auriferous. I warn you though, she is very busy and you may be in for quite a wait.',`prob0`='1.0' WHERE `ID`=8466;
UPDATE `npc_text` SET `text0_1`='Normally it would not be my place to speak with you directly; rather, you would seek an audience with milady. However, I did give you a task directly, so what is it that we need to discuss?',`prob0`='1.0' WHERE `ID`=8467;
UPDATE `npc_text` SET `text0_1`='Well this is troublesome! How am I supposed to collect the ore samples for the magisters if the mines have been overrun with gnoll vermin?',`prob0`='1.0' WHERE `ID`=8472;
UPDATE `npc_text` SET `text0_0`='Where could she possibly be? I sent my apprentice, Shatharia, to the Underlight Mines to the west quite some time ago. We need those ore samples back, and fast or our experiment is going to fail!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8474;
UPDATE `npc_text` SET `text0_1`='Sin\'dorei have lost far too much in the past years.  Our land, our homes, even our identities...$B$BIt\'s about time we started taking it all back.',`prob0`='1.0' WHERE `ID`=8476;
UPDATE `npc_text` SET `text0_1`='Think you could help me to get out of here?',`prob0`='1.0' WHERE `ID`=8478;
UPDATE `npc_text` SET `text0_0`='Stray arcane forces can do strange things to the land, the elements and even the spirits of the dead.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8488;
UPDATE `npc_text` SET `text0_0`='The High Executor is a very busy man, $c.  Maybe I can help you with whatever you need?',`text0_1`='',`prob0`='1.0' WHERE `ID`=8489;
UPDATE `npc_text` SET `text0_0`='Good to see you again, $g man! : gorgeous!; We work well together; $g see you around. : I hope we get to continue to do so.;',`text0_1`='',`prob0`='1.0' WHERE `ID`=8491;
UPDATE `npc_text` SET `text0_0`='Your help with the Shadowpine trolls is proving invaluable, $c. Keep this up and maybe we\'ll be able to turn our attention back to dealing with the Scourge.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8495;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=1,`em0_2`=500,`em0_3`=5,`em0_4`=0 WHERE `ID`=8501;
UPDATE `npc_text` SET `text0_1`='Well, you didn\'t come all this way out here to jaw over a cup of tea. Let\'s see how you might be able to help get us out of this situation.',`prob0`='1.0' WHERE `ID`=8505;
UPDATE `npc_text` SET `text0_0`='Sin\'dorei and Forsaken share a common goal in the Ghostlands, $N.  Together we shall defeat the Scourge and who knows... perhaps the Forsaken will be valuable allies in our quest to reach Outland.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8515;
UPDATE `npc_text` SET `text0_0`='It\'s a testament to our race\'s tenacity that Fairbreeze Village still stands.  We shall never concede defeat to the Scourge ever again.',`prob0`='1.0' WHERE `ID`=8535;
UPDATE `npc_text` SET `text0_0`='Dar\'Khan thinks we\'ll roll over for the Scourge without putting up a fight.  We shall prove him wrong, $N.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8548;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=2 WHERE `ID`=8550;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=6 WHERE `ID`=8553;
UPDATE `npc_text` SET `text0_0`='A list... how intriguing.  Ah yes, the shipment of fireworks for Lord Saltheril.  He hasn\'t paid for them; are you here to purchase them on his behalf, $c?',`em0_0`=0,`em0_1`=6 WHERE `ID`=8557;
UPDATE `npc_text` SET `text0_1`='Is there no end to these undead?  It seems that for every ghoul or skeleton we kill, two take its place.',`prob0`='1.0' WHERE `ID`=8558;
UPDATE `npc_text` SET `text0_0`='$C, you didn\'t happen to see a courier on your way here? We are awaiting word from Silvermoon City and their messenger is late!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8561;
UPDATE `npc_text` SET `text0_1`='We must maintain a state of vigilance, $c! Between Dar\'Khan the Betrayer and his Scourge, and the Shadowpine trolls backed by the might of Zul\'Aman, we\'re barely keeping our heads above water here. We really shouldn\'t have to be dividing our attentions!$B$BI hope you\'re here to help.',`prob0`='1.0' WHERE `ID`=8569;
UPDATE `npc_text` SET `text0_1`='I\'m glad that you\'re here to help, $c. The faster we can deal with these trolls, the faster we\'ll get to send the scourge back to where they came from.',`prob0`='1.0' WHERE `ID`=8570;
UPDATE `npc_text` SET `text0_1`='What brings you here, $N?  We don\'t see too many people around these parts.  With good reason, I suppose.',`prob0`='1.0' WHERE `ID`=8575;
UPDATE `npc_text` SET `text0_0`='I am most grateful for your help, $c!',`text0_1`='',`prob0`='1.0' WHERE `ID`=8650;
UPDATE `npc_text` SET `lang0`=7,`prob0`='1.0',`em0_1`=1,`em0_3`=1,`em0_5`=6 WHERE `ID`=8658;
UPDATE `npc_text` SET `text0_1`='Welcome to Fairbreeze Village.  Silvermoon\'s all but given up on us, but we refuse to leave.  This is our home.',`prob0`='1.0' WHERE `ID`=8699;
UPDATE `npc_text` SET `text1_1`='Could night elf saboteurs be behind this?  I doubt it.  With the load we\'ve been putting on the West Sanctum it was only a matter of time until something went wrong.',`prob1`='1.0' WHERE `ID`=8700;
UPDATE `npc_text` SET `text0_1`='Greetings, $N. My fellow Sons of Lothar and I have been stuck on this miserable world for close to twenty years now. We held on as best we could, but it still amazes me that the threats we face today are just the shadows of our past failures.$B$BPerhaps you will help us atone for them?  $B',`prob0`='1.0',`em0_1`=1 WHERE `ID`=8713;
UPDATE `npc_text` SET `text0_1`='Few bouts are won by sheer strength.  It is cunning, reflexes and knowledge of your weapon that wins the day in the end.' WHERE `ID`=8724;
UPDATE `npc_text` SET `prob0`='1.0',`em0_0`=0,`em0_1`=6,`em0_5`=0,`prob1`='1.0',`em1_0`=0,`em1_1`=1,`em1_5`=0,`prob2`='1.0',`em2_0`=0,`em2_1`=6,`em2_5`=0,`prob3`='1.0',`em3_0`=0,`em3_1`=1 WHERE `ID`=8759;
UPDATE `npc_text` SET `text0_1`='It is very important that we find out what the the night elves are up to, $c! Please concentrate all of your efforts toward that end.',`prob0`='1.0' WHERE `ID`=8769;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=6 WHERE `ID`=8788;
UPDATE `npc_text` SET `em0_1`=1,`em0_3`=1,`em0_5`=6 WHERE `ID`=8855;
UPDATE `npc_text` SET `text0_0`='The Ghostlands will not be won back by military force alone, $N.  That\'s where we magisters come in.$B$BOur guile and knowledge of the arcane are unmatched.',`text0_1`='',`prob0`='1.0' WHERE `ID`=8860;
UPDATE `npc_text` SET `text0_1`='<Eralan appears to be chewing on some deathweed.>$b$bIf you\'re looking to make a love potion, you\'ve got the wrong place.  Blinding, crippling, and killing is my business and hopefully yours.',`prob0`='1.0' WHERE `ID`=9005;
UPDATE `npc_text` SET `text0_1`='Come for some blacksmithing supplies, have ya?',`prob0`='1.0' WHERE `ID`=9019;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=6,`em1_0`=0,`em1_1`=6,`em2_0`=0,`em2_1`=6,`em3_0`=0,`em3_1`=6 WHERE `ID`=9124;
UPDATE `npc_text` SET `text0_0`='Welcome to the headquarters of the Blood Knights, the defenders of Quel\'Thalas, the faithful servants of Silvermoon, and the true masters of the Light.' WHERE `ID`=9174;
UPDATE `npc_text` SET `text0_0`='Be strong. Kael\'thas has betrayed us and what we know is in flux, but do not lose heart. We will endure, as we always have. Arthas did not crush our spirit when he swept through our land, and neither will Kael\'thas. Let it serve as a lesson to us all as we move forward to our prosperous future.',`prob0`='1.0' WHERE `ID`=9315;
UPDATE `npc_text` SET `text0_0`='If digging in the dirt is the sort of pastime you find enjoyable, go share your insanity with Belil in Farstriders\' Square. I\'m certain he\'d be happy to see he\'s not the only crazy one.',`prob0`='1.0' WHERE `ID`=9348;
UPDATE `npc_text` SET `em0_0`=0,`em0_1`=378 WHERE `ID`=9395;
UPDATE `npc_text` SET `text0_0`='My sister Silanna is naive to the growing danger in these woods. But like it or not, as soon as I get this wagon loaded we\'re moving within the city walls. $b$bIt appears that I\'ve got more bags here than I need. Perhaps you could make use of them.$B' WHERE `ID`=9630;
UPDATE `npc_text` SET `text0_0`='Can\'t thank ya enough fer helpin\' with the mines. Now, it\'s just a matter of convincing the miners to get back to work.',`text0_1`='',`prob0`='1.0' WHERE `ID`=9632;
UPDATE `npc_text` SET `text0_1`='For years, Honor Hold has stood against the horrors of Hellfire Peninsula.  Now, now that the portal has reopened and aid streams in from Azeroth, perhaps this bloody stalemate will end.' WHERE `ID`=9656;
UPDATE `npc_text` SET `text0_0`='Expedition Point is the Alliance\'s closest point of contact with the Legion Front. North of here is nothin\' but demon, demon and more demon. Travel with a buddy.',`text0_1`='',`prob0`='1.0' WHERE `ID`=9784;
