INSERT IGNORE INTO `page_text` VALUES ('3362', 'Abjuration is the study of protective magic and one of the most important schools for a young mage to study. The most generalized abjuration spell is the mana shield, a spell that transmutes raw mana into a barrier that protects the caster from attacks. Properly executed, this spell can protect the mage against even the most formidable of attacks - but the mana shield is very difficult for a novice to master. It often takes a mage months of practice to even conjure a simple mana shield, and thus, more basic alternatives exist. ', '3363');
INSERT IGNORE INTO `page_text` VALUES ('3513', 'Human - As adaptable a race as you will ever find, humans can be some of the most highly skilled magic-users.  Any list of the most powerful mages in history will be dominated by humans.  Perhaps most tellingly, the Old Wizard himself is a human.\n\nDwarf - Dwarves possess a moderate magical acuity, but tend to have difficulty at the higher echelons of wizardry.  While they tend to focus more on priestly endeavors, a rare few have been known to dabble in arcane or necromantic activities.\n', '3514');
INSERT IGNORE INTO `page_text` VALUES ('3514', 'Gnome - Gnomes are remarkably adept arcanists.  Pound for pound, they are some of the most potent casters the world has ever known, and have always had a presence in the Kirin Tor.\n\nNight Elf - While night elves tend to avoid arcane energy like it was the Scourge, their druidic powers are second to none.', '3515');
INSERT IGNORE INTO `page_text` VALUES ('3515', 'Draenei - This ancient race has brought the Alliance both powerful wizards and masterful wielders of the Light.  More recently, the Draenei have adopted shamanism after their arrival in Kalimdor.\n\nHigh Elf - The magic of the high elves is extremely powerful.  High elves possess a magical acumen that rivals that of any - even the humans.  Some of the greatest heroes in the Battle of Mount Hyjal were the High Elf priests.\n', '3516');
INSERT IGNORE INTO `page_text` VALUES ('3516', 'The Old Wizard\'s Almanac: The Horde\n\nUp until the last few years, most of my information on the Horde has been anecdotal, or inferred from my few experiences in battle against them.  However, as the Kirin Tor has recently adopted a more neutral stance in Horde-Alliance relations, the amount of information on the Horde and their magic has exploded. - O.W.\n', '3517');
INSERT IGNORE INTO `page_text` VALUES ('3517', 'Orc - Despite their obvious physical strength, they display a decent magical ability.  Orcs tend to make poor arcanists, but culturally have a heritage of peaceful shamanism, combined with a more recent focus on the darker magic of warlocks and necromancy.\n\nTauren - Few experiment with the arcane, but the bull-men are highly attuned to the magics of the earth.  As is the case with many nature-worshipping tribes, many follow the path of the shaman.  Furthermore, their most senior druids can rival the archdruids of Darnassus in power.\n', '3518');
INSERT IGNORE INTO `page_text` VALUES ('3518', 'Troll - A surprising affinity for the magic arts belies the trolls\' barbaric reputation and history.  My Zul\'tour - an expedition into the troll empires of Zul\'Aman, Zul\'Farrak, and Zul\'Drak - has revealed a startling variety in troll casters, ranging from witch doctors to shadow priests to a bizarre animal worship that most closely resembles druidism.\n\nUndead - The undead have as much magical skill as can be expected of any living human... if not more.  Sylvanas\' Forsaken, in particular, fling spells with the frightening levels of zeal.', '3519');
INSERT IGNORE INTO `page_text` VALUES ('3519', 'Blood Elf - A history of prolonged exposure to magical energy has left an indelible mark on the Blood Elves.  These lithe, magic-addicted creatures seem to fare well in any magical school they study.  Most recently, the blood elves have taken up the path of the \"Blood Knight\", which can be loosely described as a form of paladinism.\n\nTaunka - Much like their tauren cousins, taunka tend to focus on magic stemming from the earth.\n', '3520');
INSERT IGNORE INTO `page_text` VALUES ('3520', 'The Old Wizard\'s Almanac: Other Arcanist-Friendly Races\n\nMagic is not limited simply to the races of the Horde and the Alliance.  Many of the creatures that make Azeroth their home are capable of thaumaturgical pursuits. - O.W.\n', '3521');
INSERT IGNORE INTO `page_text` VALUES ('3521', 'Naga - While males are more suited for melee combat, female naga are incredible sorcerers, commanding the power of water and ice at their fingertips.  It should be noted that their ancient queen Azshara was reputedly one of the most powerful magic-users in Azeroth\'s history.\n\nNerubian - Only the most powerful Nerubian leaders have the capacity for magic.  However, following the onslaught of the Scourge, many plagued Nerubians have become necromancers.\n', '3522');
INSERT IGNORE INTO `page_text` VALUES ('3522', 'Ogre - Most of these expatriates from Draenor focus on the path of the warrior or the ranger, but a small percentage choose a life of sorcery as ogre-magi.  Cho\'gall, one of the first ogre-magi, was an immensely powerful sorcerer (in addition to simply being immense).\n\nSatyr - These dangerous creatures have features similar to those of night elves, but twisted demonic bodies. Masters of demonic magic, satyrs are incredibly dangerous. Extreme caution is advised when approaching them.', '3523');
INSERT IGNORE INTO `page_text` VALUES ('3523', 'Blue Dragons - The ancient children of Malygos are among the foremost experts on arcane magic. Some, such as the adventurous Kalecgos, are friendly to the mortal wizard and potentially could make excellent research partners. Unfortunately, recent rumors from the north indicate that some blue dragons have grown extremely hostile to other spellcasters. The reasons for this aggression are as-yet unknown.\n', '3524');
INSERT IGNORE INTO `page_text` VALUES ('3524', 'The Old Wizard\'s Almanac: The Shamanic Races\n\nMy travels have introduced me to numerous societies across Azeroth, many of whom practice shamanism.  Many of these peoples live off the land, shunning advanced society for a more nature-centric existence. - O.W.\n', '3525');
INSERT IGNORE INTO `page_text` VALUES ('3525', 'Quilboar - The few quilboar that remain in Kalimdor are known to practice geomancy, a crude form of shamanism.  Some plagued quilboar practice this form of magic even in undeath.\n\nGnoll - Gnolls are a strange race.  I once managed to gain the favor of a clan leader in Redridge by performing a basic cantrip - the kind taught to Dalaran\'s schoolchildren.  For a day, he was my best friend, until he forgot my trick and sicced his hunters on me.  Anyhow, when they can be bothered to pay attention long enough, gnolls tend to focus on elemental shamanism.\n', '3526');
INSERT IGNORE INTO `page_text` VALUES ('3526', 'Centaur - Centaur females tend to use a dark, perverted form of shamanism.  Magic use among centaur males, on the other hand, is quite rare.\n\nWolvar - This wolverine-like group may appear primitive upon first glance.  However, their tribal leaders are often very powerful shaman.\n', '3527');
INSERT IGNORE INTO `page_text` VALUES ('3527', 'Oracles - Though they are the sworn enemies of the wolvar, the oracles seem to have a nearly identical social system.  Grunt work is done by warriors, but their cultural leaders are nearly always great shamanic practitioners.\n\nFurbolg - These days, it seems few furbolg ever become shaman.  Shamanism is much more common among the free-willed furbolg tribes.  Furthermore, some free-willed furbolg are even capable of basic shapeshifting, much like a trained druid.\n', '3528');
INSERT IGNORE INTO `page_text` VALUES ('3528', 'The Old Wizard\'s Almanac: Peoples of the Land\n\nShamanism isn\'t the only nature-centric magic.  Many of Azeroth\'s simpler races perform spells that stem from the the earth\'s energies, but which cannot be called shamanism.  Whether their magic powers come from the same source as the shaman\'s magic or not is a constant point of debate in the halls of the Violet Citadel. - O.W.', '3529');
INSERT IGNORE INTO `page_text` VALUES ('3529', 'Tuskarr - The walrus-men practice a form of magic that, on its surface, is astonishingly similar to shamanism.  Our scholars have not yet deciphered the source of the tuskarr\'s magic.\n\nKobold - These simple creatures are only capable of simple earth magic.  My exploits as a youth taught me that a few of them have perfected a rather nasty fireball, but that\'s about it.\n', '3530');
INSERT IGNORE INTO `page_text` VALUES ('3530', 'Wildkin - These feathered creatures go by many names - moonkin, owlbear, and owlkin, to name a few.  These gentle giants possess a natural, druidic energy similar to that of the night elves.\n\nHarpy - The cackling bird-women are capable of powerful elemental storm magic.  Little is known about the source of their power, as 1) they attack invaders on sight, 2) few can discern any meaning behind their shrill cries, and 3) none can tolerate the smell of their nests.\n', '3531');
INSERT IGNORE INTO `page_text` VALUES ('3531', 'Murloc - For many years these enigmatic creatures appeared to be capable of only the most basic magic.  Do not be deceived by their unintelligent fae.  The fish-men are fully capable of casting potent earth and water spells, and their numbers on land increase by the day.\n\nMakrura - The lobster-like race of makrura, while widely considered to be primitive, has an innate capacity for water magic.\n', '3532');
INSERT IGNORE INTO `page_text` VALUES ('3532', 'The Old Wizard\'s Almanac: Non-Magical Creatures\n\nMagic isn\'t for everyone.  The non-intelligent beasts of the world have survived for millennia on their wits alone, as have several of the simpler races.  Some races, while socially advanced, simply prefer to avoid magic in favor of other pursuits.  As Kirin Tor, it is critically important that we understand the way that these races thrive without any magic at all. - O.W.\n', '3533');
INSERT IGNORE INTO `page_text` VALUES ('3533', 'Goblin - Goblins tend to be distrustful of magic, preferring to focus mainly on technological ventures.  Unlike their gnomish counterparts, they lack the capacity to understand and appreciate the arcane.  That being said, there are some that have combined their technology with magic, yielding interesting results.\n\nTrogg - These primitive creatures simply lack the intelligence necessary for magic.\n', '3534');
INSERT IGNORE INTO `page_text` VALUES ('3534', 'Magnataur - The enormous magnataur have little to no magical affinity.  Magnataur casters are very rare, and tend to be follow a shamanic route if they practice magic at all.  I can tell you first-hand, however, that they won\'t go down without a fight, and their thick hides can withstand several of the most powerful frostbolts.\n\nVrykul - While Northrend\'s half-giants naturally know little to no magic, some have been trained in necromancy by the Lich King. I have also heard rumors of ?rune magic? of some kind, but I have not yet had the opportunity to research this intriguing subject in depth.\n', '0');
INSERT IGNORE INTO `page_text` VALUES ('3367', 'Conjuration is the study of summoning - both creatures and objects. Ever really, really wanted a fresh drink of spring water when you\'re in the middle of nowhere? Conjuration, my friend, is the answer. There is nothing more enjoyable for a mage than creating a fresh slice of bread or a glass of water. Just ask any of us!', '3368');
INSERT IGNORE INTO `page_text` VALUES ('3368', 'More formidable specialists in conjuration can summon several glasses of water at once, or perhaps even a tankard. A few daring wizards have occasionally attempted to summon water without remembering the glass - and thus, the art of summoning water elementals was born. Water elementals are a wizard\'s best friend. (Felhounds are not, in fact, friendly at all.) A summoned elemental is a formidable ally in combat, a great listener, and they even taste great!', '3369');
INSERT IGNORE INTO `page_text` VALUES ('3369', 'There are several wizards who have chosen to follow the refreshing path of conjuration. Captain Balinda Stonehearth is a fine example of a mage who has chosen to adapt conjuration magic for battle. Perhaps the most famous conjuror of our time, however, was the beloved Archmage Nileas Aran. Aran was not only noted for being able to summon several elementals at once, he also perfected a recipe for conjuring sparkling cider. It should also be noted that Nileas Aran was no simple jester. That\'s what magic is all about.', '0');
